def translate_to_english(query):
    if regex.sub(r'\p{Punctuation}|\s', '', query) == "":
        return ""
    try:
        if detect(query) == 'en':
            return query
    except Exception as e:
        pass
        # print("detect error", e, query)
    if len(query) > 4096 * 4:
        query = query[:4096 * 4]
    patience = 3
    while patience > 0:
        try:
            return PyDeepLX.translate(query)
        except Exception as e:
            print(f"翻译错误: {str(e)}")
            patience -= 1
            time.sleep(300)
    return query + "[EN-TransError]"
